import { React, useEffect, useState } from "react";
import axios from "axios";

const Kategorije = () => {
  const [kat, setKat] = useState();
  useEffect(async () => {
    const result = await axios("http://localhost:5000/kategorije/");
    setKat(result.data);
  }, []);

  return (
    <ul id="predmeti">
      {kat.map((kategorija) => (
        <p>{kat.naziv}</p>
      ))}
      <li className="predmet">eq</li>
    </ul>
  );
};

export default Kategorije;
